  return (
    <div className="open-orders-container">
      <div className="open-orders-h1">
        <h2>Offene Bestellungen</h2>
        <span>see all</span>
      </div>
      <div className="items-container">
        <h3>
          {products
            ? products.map((x) => {
                return x.img;
              })
            : 'no button works'}
        </h3>
        <h5>Category</h5>
        <h6>Order Date</h6>
      </div>
    </div>
  );
};

export default ItemsOpenOrder;
